const promotionsTableColumns = [
  {
    name: "num1",
    title: "Num1",
    getCellValue: (row: any) => row.num1,
  },
  {
    name: "num2",
    title: "Num2",
    getCellValue: (row: any) => row.num2,
  },
  {
    name: "oper",
    title: "Operator",
    getCellValue: (row: any) => row.oper,
  },
  {
    name: "result",
    title: "Result",
    getCellValue: (row: any) => row.result,
  },

  { name: "Action", title: "Action" },
];

const columnExtensions = [
  { columnName: "num1", width: 220 },
  { columnName: "num2", width: 200 },
  { columnName: "oper", width: 220 },
  { columnName: "result", width: 220 },
  { columnName: "Action", width: 120 },
];
export { promotionsTableColumns, columnExtensions };
